import React, { Component } from 'react'
import {Button,FormGroup,Label,Form} from 'reactstrap'

export default class FormDemo2 extends Component {
    state = {
        username: '',
        email:'',
        pass:'',
        city:'',
    }
    render() {
    return (
      <div>
        <Form>
            <FormGroup>
            <Label for='email'>Email</Label>
            <input type='text'></input>
            </FormGroup>
        </Form>
      </div>
    )
  }
}
